import React from "react";
import './Home.css';

function Home() {
    const handleSubmit = (event) => {
        alert('A name was submitted: ' + this.state.value);
        event.preventDefault();
    }

    return (
        <div className="border-box">
            <form onSubmit={handleSubmit}>
                <div className="form-header">Patient Information</div>
                <div className="form-fields-class">
                    <div>
                        <span className="left-Style">
                            <label htmlFor="firstName">First Name<span className="req">*</span></label>
                            <input id="name" type="text" name="firstName" placeholder="First Name"></input>
                        </span>
                        <span className="right-Style">
                            <label htmlFor="lastName">Last Name<span className="req">*</span></label>
                            <input id="name" type="text" name="lastName" placeholder="Last Name"></input>
                        </span>
                    </div>

                </div>
            </form>
        </div>
    );
}

export default Home;
